import styled from "styled-components";
import React from "react";
import Avartar1 from "../../dummyResources/Avartar1.png";
import MainPicDummy from "../../dummyResources/MainPicDummy.jpg";

interface Props {}

const Header = styled.div`
  width: 100%;
  display: flex;
  justify-content: space-between;
`;

const HeaderWrapper = styled.div`
  display: flex;
  width: 100%;
  padding: 10px;
  justify-content: space-between;
`;

const ContainerFeedPage = styled.div`
  width: 100%;
`;

const AvartarImg = styled.img`
  width: 30px;
  height: 30px;
  border-radius: 50%;
`;

const HeaderTitle = styled.p`
  font-size: 30px;
  font-weight: 800;
`;

const RequestP = styled.p`
  font-size: 16px;
  font-weight: 600;
  color: gray;
  padding-top: 8px;
`;

const Promo = styled.div`
  width: 100%;
  margin-top: 20px;
`;

const PromoPic = styled.img`
  width: 100%;
`;

const PromoText = styled.div`
  bottom: -50%;
`;

export default function FeedPage(props: Props) {
  return (
    <ContainerFeedPage>
      <Header>
        <HeaderWrapper>
          <HeaderTitle>안암에서</HeaderTitle>
          <RequestP>식탁 건의하기</RequestP>
        </HeaderWrapper>
      </Header>
      <Promo>
        <PromoPic src={MainPicDummy} />
        <PromoText>hihihihihi</PromoText>
      </Promo>

      <AvartarImg src={Avartar1} />
      <div>
        <h1>Feed Page</h1>
      </div>
      <ul>
        <li>
          <a></a>
        </li>
      </ul>
    </ContainerFeedPage>
  );
}
